import React from 'react';
import { projectsData, projectsNav } from './Data';


const Works = () => {
    return(
        <div className="work__filters">
            {projectsNav.map((item,index) => {
                return <span className='work__item' key={index}>
                    {item.name}</span>
            })}
        </div>

        .work__container

    )
}

export default Works
